import React, { Component } from "react";

export default class Contact extends Component {
  render() {
    return (
      <form>
        <h1>"Have a recipe? Submit it to us!"</h1>
        <p>Enter your name:</p>
        <input type="text" />
      </form>
    );
  }
}
